script: |
  super -f tsv -I q7841.sql | sort > q7841.out

vector: true

inputs:
  - name: q7841.sql
    data: |
      SELECT DISTINCT col2, col2 AS col0 FROM tab1 WHERE ( + col0 / + CAST ( + + col0 AS INTEGER ) * + col2 - + col1 * - col2 * + CAST ( - + col0 AS INTEGER ) ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q7841.out
    data: |
      59	59
      68	68
      96	96
